import React, { useState, useRef, useEffect } from 'react';
import styled from 'styled-components';
import MessageInput from './MessageInput';

interface InterpretationViewProps {
  interpretation: string;
  personaName: string;
  onSendMessage: (message: string) => Promise<boolean>;
  isLoading: boolean;
  messages: Array<{
    role: 'user' | 'assistant';
    content: string;
    timestamp: string;
  }>;
}

const Container = styled.div`
  display: flex;
  flex-direction: column;
  height: 100%;
  background: white;
`;

const InterpretationSection = styled.div`
  padding: 24px;
  border-bottom: 2px solid #e0e0e0;
  background: linear-gradient(135deg, #f8f9fa 0%, #f1f3f4 100%);
`;

const InterpretationTitle = styled.h2`
  font-size: 20px;
  font-weight: 600;
  color: #333;
  margin-bottom: 16px;
  display: flex;
  align-items: center;
  gap: 8px;
`;

const InterpretationContent = styled.div`
  background: white;
  border: 1px solid #e0e0e0;
  border-radius: 12px;
  padding: 20px;
  line-height: 1.6;
  color: #555;
  font-size: 14px;
  white-space: pre-line;
  box-shadow: 0 2px 8px rgba(0, 0, 0, 0.08);
`;

const ChatSection = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  overflow: hidden;
`;

const ChatMessages = styled.div`
  flex: 1;
  overflow-y: auto;
  padding: 20px;
  display: flex;
  flex-direction: column;
  gap: 16px;
`;

const MessageBubble = styled.div<{ isUser: boolean }>`
  max-width: 70%;
  padding: 12px 16px;
  border-radius: 18px;
  align-self: ${props => props.isUser ? 'flex-end' : 'flex-start'};
  background: ${props => props.isUser 
    ? 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)' 
    : '#f1f3f4'
  };
  color: ${props => props.isUser ? 'white' : '#333'};
  font-size: 14px;
  line-height: 1.4;
  box-shadow: 0 2px 8px rgba(0, 0, 0, 0.1);
  word-wrap: break-word;
`;

const MessageTime = styled.div`
  font-size: 11px;
  color: #999;
  margin-top: 4px;
  text-align: ${props => props.style?.textAlign || 'left'};
`;

const ChatInputSection = styled.div`
  padding: 16px 20px;
  border-top: 1px solid #e0e0e0;
  background: #f8f9fa;
`;

const EmptyChat = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  color: #999;
  font-size: 14px;
  text-align: center;
`;

const InterpretationView: React.FC<InterpretationViewProps> = ({
  interpretation,
  personaName,
  onSendMessage,
  isLoading,
  messages,
}) => {
  const chatMessagesRef = useRef<HTMLDivElement>(null);

  useEffect(() => {
    if (chatMessagesRef.current) {
      chatMessagesRef.current.scrollTop = chatMessagesRef.current.scrollHeight;
    }
  }, [messages]);

  const formatTime = (timestamp: string) => {
    return new Date(timestamp).toLocaleTimeString('ko-KR', {
      hour: '2-digit',
      minute: '2-digit',
    });
  };

  return (
    <Container>
      <InterpretationSection>
        <InterpretationTitle>
          üß† {personaName}Ïùò Ìï¥ÏÑù
        </InterpretationTitle>
        <InterpretationContent>
          {interpretation}
        </InterpretationContent>
      </InterpretationSection>

      <ChatSection>
        <ChatMessages ref={chatMessagesRef}>
          {messages.length === 0 ? (
            <EmptyChat>
              <div style={{ fontSize: '24px', marginBottom: '8px' }}>üí¨</div>
              <div>Ìï¥ÏÑùÏóê ÎåÄÌï¥ Îçî ÏûêÏÑ∏Ìûà ÏßàÎ¨∏Ìï¥Î≥¥ÏÑ∏Ïöî</div>
              <div style={{ fontSize: '12px', marginTop: '4px' }}>
                {personaName}ÏôÄ ÎåÄÌôîÎ•º ÎÇòÎàå Ïàò ÏûàÏäµÎãàÎã§
              </div>
            </EmptyChat>
          ) : (
            messages.map((message, index) => (
              <div key={index}>
                <MessageBubble isUser={message.role === 'user'}>
                  {message.content}
                </MessageBubble>
                <MessageTime style={{ textAlign: message.role === 'user' ? 'right' : 'left' }}>
                  {formatTime(message.timestamp)}
                </MessageTime>
              </div>
            ))
          )}
          
          {isLoading && (
            <div style={{ 
              display: 'flex', 
              justifyContent: 'center', 
              padding: '20px' 
            }}>
              <div style={{ 
                width: '20px', 
                height: '20px', 
                border: '2px solid #f3f3f3', 
                borderTop: '2px solid #667eea', 
                borderRadius: '50%', 
                animation: 'spin 1s linear infinite' 
              }} />
            </div>
          )}
        </ChatMessages>

        <ChatInputSection>
          <MessageInput
            onSendMessage={onSendMessage}
            disabled={isLoading}
            placeholder={`${personaName}ÏóêÍ≤å Ìï¥ÏÑùÏóê ÎåÄÌï¥ ÏßàÎ¨∏Ìï¥Î≥¥ÏÑ∏Ïöî...`}
          />
        </ChatInputSection>
      </ChatSection>
    </Container>
  );
};

export default InterpretationView;
